import React, { useState, useEffect } from "react";
import "./App.css";
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import Dropdown from 'react-bootstrap/Dropdown';
import DropdownButton from 'react-bootstrap/DropdownButton';

import ReactDOM from 'react-dom';
function Header() {
  return (
    <header>
      <h1>Let's Predict Success of your restaurant</h1>
      <nav>
        <a href="#about">Genius Developers</a>
        {/* <a href="#account">Account</a> */}
      </nav>
    </header>
  );
}

// About section component
function About() {
  return (
    <section id="about">
      <h2>About</h2>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam pretium, velit ut elementum congue, arcu ipsum convallis mi, at suscipit magna mi nec est. Suspendisse potenti. Proin sed eros quam. Fusce consequat vestibulum nisi vel molestie. Integer malesuada nulla ac justo hendrerit, quis elementum tellus dapibus. Donec vehicula consectetur arcu, ac aliquam metus vehicula vel. </p>
    </section>
  );
}
const Dropdown_Select =  ({type,fields}) => {
  return (
    <div class="dropdown">
    <button button class="dropbtn">Select {type}</button>
    <div class="dropdown-content">
      {/* <button href="#">fiel</button>
      <button href="#">Link 1</button>
      <button href="#">Link 1</button> */}
      {
        fields.map((field,index) => {
          return (
            <button href="#">{field} good</button>
          )
        })
      }
    </div>
  </div>
  );
}
// Account section component
function Account() {
  return (
    <section id="account">
      <h2>Enter restaurant details</h2>
      <form>
        <label htmlFor="username">Online order facility? :</label>
        <input type="text" id="username" name="username" /><br /><br />
        <label htmlFor="password">Booking facility? :</label>
        <input type="password" id="password" name="password" /><br /><br />
        <label htmlFor="password">Select Location :</label>
        <input type="password" id="password" name="password" /><br /><br />
        <label htmlFor="password">Select restaurant type :</label>
        <input type="password" id="password" name="password" /><br /><br />
        <label htmlFor="password">Select Cuisines of your restaurant :</label>      
        <Dropdown_Select type='cusine' fields={['Chinies','Italian']}/><br /><br />   
        <label htmlFor="password">Enter Cost :</label>
        <input type="password" id="password" name="password" /><br /><br />
        <input type="submit" value="Submit" />
      </form>
    </section>
  );
}

function App() {
    // usestate for setting a javascript
    // object for storing and using data
    const [data, setdata] = useState({
        name: "",
        age: 0,
        date: "",
        programming: "",
    });
    const [online,setOnline] = React.useState(true);
    const [table,settable] = React.useState(true);
    const [location,setlocation] = React.useState("");
    const [rest_type,setRest_type] = React.useState("");
    const [cusine,setCusine] = React.useState("");
    const [cost,setCost] = React.useState("");
    // Using useEffect for single rendering
    useEffect(() => {
        // Using fetch to fetch the api from 
        // flask server it will be redirected to proxy
        fetch("/data").then((res) =>
            res.json().then((data) => {
                // Setting a data from api
                setdata({
                    name: data.Name,
                    age: data.Age,
                    date: data.Date,
                    programming: data.programming,
                });
            })
        );
    }, []);

    return (

      <div className="App">
      <Header />
      <main>
        {/* <About /> */}
        <Account />
      </main>
    </div>
    );
}

export default App;
